import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    verTexto.innerHTML = 
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          <input type="text" id="introducirTexto">
          </input>
        </div>
        <div id="verTexto" >

        </div>
      </header>
    </div>
  );
}

export default App;
